import React, { useState } from "react";
import "./App.css";

export default function App() {
  const [messages, setMessages] = useState([
    { from: "user", text: "draw sun and grass with tree" },
    { from: "bot", text: "ציור נוסף בוצע בהצלחה!" },
    { from: "user", text: "now add person" },
    { from: "bot", text: "ציור נוסף בוצע בהצלחה!" }
  ]);
  const [input, setInput] = useState("");
  const [drawingId, setDrawingId] = useState(10);

  const handleSend = () => {
    if (!input.trim()) return;
    setMessages([...messages, { from: "user", text: input }]);
    setInput("");
    // כאן תוכל להוסיף קריאה לשרת
  };

  return (
    <div className="app-container">
      <div className="toolbar">
        <select
          value={drawingId}
          onChange={e => setDrawingId(Number(e.target.value))}
        >
          <option value={10}>Drawing #10</option>
          <option value={11}>Drawing #11</option>
        </select>
        <button className="toolbar-btn blue">+ New Drawing</button>
        <button className="toolbar-btn green">Send</button>
        <button className="toolbar-btn yellow">Undo</button>
        <button className="toolbar-btn orange">Clear</button>
        <button className="toolbar-btn purple">Save</button>
      </div>
      <div className="main-content">
        <div className="chat-section">
          <div className="chat-title">your chat with the bot</div>
          <div className="chat-messages">
            {messages.map((msg, i) => (
              <div
                key={i}
                className={`chat-msg ${msg.from === "user" ? "user" : "bot"}`}
              >
                {msg.text}
              </div>
            ))}
          </div>
          <div className="chat-input-row">
            <input
              type="text"
              placeholder=" הודעה..."
              value={input}
              onChange={e => setInput(e.target.value)}
              onKeyDown={e => e.key === "Enter" && handleSend()}
            />
            <button onClick={handleSend}>שלח</button>
          </div>
        </div>
        <div className="canvas-section">
          {/* כאן תוכל להטמיע קומפוננטת Canvas אמיתית */}
          <svg width="600" height="400" style={{ background: "#fff" }}>
            שמש
            <circle cx="150" cy="100" r="50" fill="yellow" />
            {/* ראש של אדם */}
            <circle cx="300" cy="100" r="35" fill="red" />
            {/* גוף, ידיים, רגליים */}
            <line x1="300" y1="135" x2="300" y2="250" stroke="blue" strokeWidth="3" />
            <line x1="300" y1="170" x2="260" y2="200" stroke="blue" strokeWidth="3" />
            <line x1="300" y1="170" x2="340" y2="200" stroke="blue" strokeWidth="3" />
            <line x1="300" y1="250" x2="270" y2="320" stroke="blue" strokeWidth="3" />
            <line x1="300" y1="250" x2="330" y2="320" stroke="blue" strokeWidth="3" />
            {/* דשא */}
            <rect x="100" y="350" width="400" height="40" fill="green" />
            {/* עץ - גזע */}
            <rect x="420" y="220" width="30" height="90" fill="#a33" />
            {/* עץ - עלים */}
            <ellipse cx="435" cy="220" rx="50" ry="25" fill="green" />
          </svg>
        </div>
      </div>
    </div>
  );
}
